      "content": "// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./pancake/IPancakeRouter02.sol";
import "./pancake/IPancakePair.sol";

contract LiquidityQJK is Ownable {
    IERC20 public tokenQJK;
    IERC20 public tokenUSDT;

    IPancakePair public V2Pair;
    IPancakeRouter02 public router;

    mapping(address => uint256) public amounts;
    bool public firstLiquidityAdded = false;

    function addLiquidityAndTransfer(uint256 amount) public {
        uint256 totalAmount = amounts[msg.sender];

        require(totalAmount >= amount, "Recipient has no allocated amount");

        uint256 tokenQJKAmount = amount / 2;
        uint256 tokenUSDTAmount;

        if (!firstLiquidityAdded) {
            tokenUSDTAmount = tokenQJKAmount / 1666666;  // Set ratio to 1666666 for the first liquidity addition
            firstLiquidityAdded = true;  // Update the state variable
        } else {
            tokenUSDTAmount = getReserveAmount(address(tokenQJK), tokenQJKAmount);  // Use reserve-based ratio for subsequent additions
        }

        // Ensure the contract has enough QJK tokens
        require(tokenQJK.balanceOf(address(this)) >= tokenQJKAmount, "Not enough QJK tokens in the contract");

        // Transfer USDT from user to the contract
        require(tokenUSDT.transferFrom(msg.sender, address(this), tokenUSDTAmount), "USDT transfer failed");
        uint256 deadline = block.timestamp + 15 minutes;

        // Approve tokens to router
        tokenQJK.approve(address(router), tokenQJKAmount);
        tokenUSDT.approve(address(router), tokenUSDTAmount);

        // Add liquidity
        (,, uint256 liquidity) = router.addLiquidity(
            address(tokenQJK),
            address(tokenUSDT),
            tokenQJKAmount,
            tokenUSDTAmount,
            0,
            0,
            msg.sender,
            deadline
        );
        require(liquidity > 0, "Add liquidity failed");

        // Transfer remaining QJK tokens to the user
        require(tokenQJK.transfer(msg.sender, tokenQJKAmount), "QJK transfer failed");

        // Update user's allocated amount
        amounts[msg.sender] = totalAmount - amount;
    }

    function setAllUserAmounts(address[] memory _recipients, uint256[] memory _amounts) public onlyOwner {
        require(_recipients.length == _amounts.length, "Recipients and amounts length mismatch");
        for (uint256 i = 0; i < _recipients.length; i++) {
            amounts[_recipients[i]] = amounts[_recipients[i]] + _amounts[i];
        }
    }

    function setTokenAddresses(address _tokenQJKAddress, address _tokenUSDTAddress) public onlyOwner {
        tokenQJK = IERC20(_tokenQJKAddress);
        tokenUSDT = IERC20(_tokenUSDTAddress);
    }

    function setV2PairAndRouterAddresses(address _V2PairAddress, address _routerAddress) public onlyOwner {
        V2Pair = IPancakePair(_V2PairAddress);
        router = IPancakeRouter02(_routerAddress);
    }

    function getReserveAmount(address tokenQJKAddress, uint amountIn) public view returns (uint amountOut) {
        (uint112 reserve0, uint112 reserve1,) = V2Pair.getReserves();
        address token0 = V2Pair.token0();
        (uint112 reserveIn, uint112 reserveOut) = tokenQJKAddress == token0 ? (reserve0, reserve1) : (reserve1, reserve0);
        if(reserveIn == 0){
            return 0;
        }else
        {
            return (reserveOut * amountIn) / reserveIn;
        }
    }

    function getAmounts(address add) public view returns (uint256) {
        return amounts[add];
    }

    function getAmounts2(address add) public view returns (uint256) {
        return getReserveAmount(address(tokenQJK),amounts[add] / 2);
    }

    function claimToken(address token, uint256 amount) external onlyOwner {
        IERC20(token).transfer(msg.sender, amount);
    }



}
